type DownloadInvoicePdfProps = {
  data?: InvoiceData[];
  options?: InvoiceOptions;
  children: (props: {
    handlePrint: () => void;
    setContent: (data: InvoiceData[]) => void;
  }) => JSX.Element;
};

export const DownloadInvoicePdf = ({
  data,
  options,
  children,
}: DownloadInvoicePdfProps) => {
  const [isPrinting, setIsPrinting] = useState(false);
  const [defaultTitle] = useState(document.title);

  const [content, setContent] = useState(data);

  useEffect(() => {
    setContent(data);
  }, [data]);

  const componentRef = useRef<any>();
  const handlePrint = useReactToPrint({
    content: () => componentRef.current as any,
    onBeforeGetContent: () => {
      flushSync(() => {
        setIsPrinting(true);
      });
      if(content?.length === 1 && content?.[0]){
        document.title = `${content[0].customer.name}(${content[0].invoice_number})`
      }else{
        document.title = `Invoices`
      }
    },
    onAfterPrint: () => {
      setIsPrinting(false),
      document.title = defaultTitle
    }
  });

  return (
    <>
      {children({
        handlePrint,
        setContent: (data) =>
          flushSync(() => {
            setContent(data);
          }),
      })}
      <div style={{ display: "none" }}>
        <div ref={componentRef}>
          {isPrinting && (
            <>
              <style>
                {`
            @page {
                size: A4 portrait;
            }
            `}
              </style>
              <div>
                {content?.map((invoice) => (
                  <Invoice data={invoice} options={options} />
                ))}
              </div>
            </>
          )}
        </div>
      </div>
    </>
  );
};

